import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className="homeTab"></div>
        <div className="workTab"></div>
        <div className="educationTab"></div>
        <div className="originTab"></div>
        <div className="favoritesTab"></div>
        <div className="landingTab"></div>
      </header>
    </div>
  );
}

export default App;
